import * as o from "react";
import r from "../lib/IconBase.es.js";
import t from "../defs/Numpad.es.js";
const a = o.forwardRef((m, e) => /* @__PURE__ */ o.createElement(r, { ref: e, ...m, weights: t }));
a.displayName = "NumpadIcon";
const s = a;
export {
  s as Numpad,
  a as NumpadIcon
};
